static const void * _GetImageById(U32 Id, U32 * pSize) {
  switch (Id) {
  case ID_IMAGE_0_IMAGE_0:
    *pSize = sizeof(_acImage_0);
    return (const void *)_acImage_0;
  case ID_IMAGE_1_IMAGE_0:
    *pSize = sizeof(_acImage_1);
    return (const void *)_acImage_1;
  }
  return NULL;
}

static void setVoltageItem(WM_HWIN hNewItem)
{
   WM_HWIN hItem;

   if( hOwnHandle != 0 )
   {
      if( currentVoltageSetting != VOLTAGE_SET_NONE )
      {
         hItem = WM_GetDialogItem(hOwnHandle, currentVoltageSetting+ID_TEXT_0-1);
         TEXT_SetBkColor(hItem, GUI_WHITE);
         TEXT_SetTextColor(hItem, GUI_BLACK);
      }
      hItem = WM_GetDialogItem(hOwnHandle, hNewItem);
      TEXT_SetBkColor(hItem, GUI_BLUE);
      TEXT_SetTextColor(hItem, GUI_WHITE);
      currentVoltageSetting = hNewItem - ID_TEXT_0 + 1;
   }
}

static void setVisibleItem(bool vis )
{
   WM_HWIN hItem;

   if( hOwnHandle != 0 )
   {
	  hItem = WM_GetDialogItem(hOwnHandle, ID_TEXT_6);
	  if( vis == true )
	  {
		 TEXT_SetText(hItem, "ON");
		 TEXT_SetBkColor(hItem, GUI_GREEN);
		 TEXT_SetTextColor(hItem, GUI_BLACK);
	  }
	  else
	  {
		 TEXT_SetText(hItem, "OFF");
		 TEXT_SetBkColor(hItem, GUI_RED);
		 TEXT_SetTextColor(hItem, GUI_WHITE);
	  }
   }
}

