/*********************************************************************
*
*       _cbDialog
*/
static void _cbChannelDialog(WM_MESSAGE * pMsg)
{
  const void * pData;
  WM_HWIN      hItem;
  U32          FileSize;
  int          NCode;

  switch (pMsg->MsgId) {
  case WM_INIT_DIALOG:
    //
    // Initialization of 'Text50'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_0);
    TEXT_SetFont(hItem, GUI_FONT_20B_ASCII);
    TEXT_SetTextColor(hItem, GUI_BLACK);
    TEXT_SetText(hItem, "5.0V");
    TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
    //
    // Initialization of 'Text20'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_1);
    TEXT_SetFont(hItem, GUI_FONT_20B_ASCII);
    TEXT_SetTextColor(hItem, GUI_BLACK);
    TEXT_SetText(hItem, "2.0V");
    TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
    //
    // Initialization of 'Text10'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_2);
    TEXT_SetFont(hItem, GUI_FONT_20B_ASCII);
    TEXT_SetTextColor(hItem, GUI_BLACK);
    TEXT_SetText(hItem, "1.0V");
    TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
    //
    // Initialization of 'Text05'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_3);
    TEXT_SetFont(hItem, GUI_FONT_20B_ASCII);
    TEXT_SetTextColor(hItem, GUI_BLACK);
    TEXT_SetText(hItem, "0.5V");
    TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
    //
    // Initialization of 'Text02'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_4);
    TEXT_SetFont(hItem, GUI_FONT_20B_ASCII);
    TEXT_SetTextColor(hItem, GUI_BLACK);
    TEXT_SetText(hItem, "0.2V");
    TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
    //
    // Initialization of 'Text01'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_5);
    TEXT_SetFont(hItem, GUI_FONT_20B_ASCII);
    TEXT_SetTextColor(hItem, GUI_BLACK);
    TEXT_SetText(hItem, "0.1V");
    TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
    //
    // Initialization of 'TextOnOff'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_6);
    TEXT_SetFont(hItem, GUI_FONT_32B_ASCII);
    TEXT_SetText(hItem, "OFF");
    TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
    TEXT_SetTextColor(hItem, GUI_MAKE_COLOR(0x000000FF));
    //
    // Initialization of 'TextOffset'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_7);
    TEXT_SetFont(hItem, GUI_FONT_32B_ASCII);
    TEXT_SetTextColor(hItem, GUI_BLACK);
    TEXT_SetText(hItem, "CH2:");
    //
    // Initialization of 'Image'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_0);
    pData = _GetImageById(ID_IMAGE_0_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);
    //
    // Initialization of 'Image'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_1);
    pData = _GetImageById(ID_IMAGE_1_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);
    //
    // Initialization of 'Text'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_8);
    TEXT_SetFont(hItem, GUI_FONT_16B_ASCII);
    TEXT_SetTextColor(hItem, GUI_BLACK);
    TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
    TEXT_SetText(hItem, "0");

    hRepeateTimer = WM_CreateTimer(pMsg->hWin, ID_REPEATE_TIMER, 0, 0);
    break;

  case WM_TIMER:
	if( pressedKey != ARROW_KEY_NONE )
	{
		osziHandleArrowKey(pressedKey);
		currentRepeateTime -= 10;
		if( currentRepeateTime < 50) currentRepeateTime = 50;
        WM_RestartTimer(pMsg->Data.v, currentRepeateTime);
	}
    break;

  case WM_NOTIFY_PARENT:
    hItem    = WM_GetId(pMsg->hWinSrc);    /* Id of widget */
    NCode = pMsg->Data.v;               /* Notification code */

    // Is it a voltage selection?
    if( (hItem >= ID_TEXT_0) && (hItem <= ID_TEXT_5) )
    {
      if( NCode == WM_NOTIFICATION_CLICKED)
      {
        setVoltageItem( hItem );
        //TODO:WW: Implement callback or user message for time selection handling
        setChannelConfig(currentChannelSelection, currentVoltageSetting, currentVisibility);
      }
    }
    else if( hItem == ID_TEXT_6 ) // Enable
    {
      if( NCode == WM_NOTIFICATION_CLICKED)
      {
        currentVisibility = !currentVisibility; // Toggle
        setVisibleItem( currentVisibility );
        //TODO:WW: Implement callback or user message for time selection handling
        setChannelConfig(currentChannelSelection, currentVoltageSetting, currentVisibility);
      }
    }
    else if( hItem == ID_IMAGE_0 ) // UP
    {
      if( NCode == WM_NOTIFICATION_CLICKED)
      {
		pressedKey = ARROW_KEY_UP;
        //TODO:WW: Implement callback or user message for arrow key handling
		osziHandleArrowKey(pressedKey);
		currentRepeateTime = 200;
        WM_RestartTimer(hRepeateTimer, currentRepeateTime);
      }
      else if( NCode == WM_NOTIFICATION_RELEASED)
      {
  		pressedKey = ARROW_KEY_NONE;
        WM_RestartTimer(hRepeateTimer, 0);
  		osziHandleArrowKey(pressedKey);
      }
    }
    else if( hItem == ID_IMAGE_1 ) // DOWN
    {
      if( NCode == WM_NOTIFICATION_CLICKED)
      {
		pressedKey = ARROW_KEY_DOWN;
        //TODO:WW: Implement callback or user message for arrow key handling
		osziHandleArrowKey(pressedKey);
		currentRepeateTime = 200;
        WM_RestartTimer(hRepeateTimer, currentRepeateTime);
      }
      else if( NCode == WM_NOTIFICATION_RELEASED)
      {
  		pressedKey = ARROW_KEY_NONE;
        WM_RestartTimer(hRepeateTimer, 0);
  		osziHandleArrowKey(pressedKey);
      }
    }
    break;

  case WM_DELETE:
    if(hRepeateTimer!=0)
    {
       WM_DeleteTimer(hRepeateTimer);
       hRepeateTimer = 0;
    }
    break;

  default:
    WM_DefaultProc(pMsg);
    break;
  }
}

